ACCOUNTS_MAINNET_ID="rsrme-dqaaa-aaaam-ac7za-cai"
INSURANCE_MAINNET_ID="rvqkq-oiaaa-aaaam-ac7zq-cai"
MAIN_MAINNET_ID="rax35-paaaa-aaaam-ac72a-cai"
AEGIS_LEDGER_MAINNET_ID="rovwv-uqaaa-aaaam-ac73a-cai"
AEGIS_LEDGER_INDEX_MAINNET_ID="rjuqb-ziaaa-aaaam-ac73q-cai"



function deploy_aegis_ledger(){

    DEFAULT="up5qv-6itp6-z5fuj-kfq2a-qohj4-ckibb-lq6tt-34j2c-i2d27-3gqlm-pqe"
    MINTING_PRINCIPAL="upy75-k72qv-qc4hu-s3kwb-yd46z-f3vm4-4kgke-pkoce-ayjzn-gy35m-7ae"
    CONTROLLER_PRINCIPAL="upy75-k72qv-qc4hu-s3kwb-yd46z-f3vm4-4kgke-pkoce-ayjzn-gy35m-7ae"

    PRE_MINTED_TOKENS="10_000_000_000_000"


    LOGO_BASE64_ENCODED_SVG="data:image/png;base64,"

    
      read -r -d '' aegis_ledger_argument <<CANDID
    (variant {
        Init = record {
            fee_collector_account =opt {
                owner = principal "$MAIN_MAINNET_ID"
            };
            minting_account = record {
                owner = principal "$MINTING_PRINCIPAL"
            };
            feature_flags  = opt record { icrc2 = true };
            decimals = opt 8; 
            max_memo_length = opt 80;
            transfer_fee = 100_000 ;
            token_symbol = "AEGIS";
            token_name = "AEGIS FINANCE";
            metadata = vec {
               record {
                 "icrc1:logo";
                 variant {
                    Text = "$LOGO_BASE64_ENCODED_SVG"
                        };
                    };
            };
            initial_balances = vec { record { record { owner = principal "$DEFAULT"; }; $PRE_MINTED_TOKENS; }; };
            archive_options = record {
            num_blocks_to_archive = 1000; 
            trigger_threshold = 2000; 
            max_message_size_bytes = null; 
            cycles_for_archive_creation = opt 2_000_000_000_000; 
            controller_id = principal "$CONTROLLER_PRINCIPAL";
            }
        }
    })
CANDID

    dfx  build  --network ic aegis_ledger
    dfx canister install --network ic aegis_ledger --argument "$aegis_ledger_argument"

}

function deploy_aegis_ledger_index(){

      read -r -d '' aegis_index_argument <<CANDID
    (opt variant {
        Init = record {
        ledger_id = principal "$AEGIS_LEDGER_MAINNET_ID"
           
             }
    })
CANDID

  dfx deploy --network ic aegis_index --argument "$aegis_index_argument"  

  #
  #
  #
  dfx canister --network ic call aegis_index ledger_id '()'
  dfx canister --network ic  call aegis_index status '()'
}

function main(){

    deploy_aegis_ledger
    deploy_aegis_ledger_index
}

main